import scala.collection._
import scala.collection.immutable._

val MinContentLength = 1000
val CheckFirst = 500
val EligibleCount = 100

def isEnglishTextNaive(s: String): Boolean = {
    if (s.length < MinContentLength) {
        false
    } else {
        var i = 0
        var count = 0
        while (i < CheckFirst && count < EligibleCount) {
            val c = s.charAt(i)
            if ('a' <= c && c <= 'z' || 'A' <= c && c <= 'Z' ) {
               count = count + 1
            }
            i = i + 1
        }
        count >= EligibleCount
    }
}

val test1 = Array.fill(11000)("a").mkString("")
isEnglishTextNaive(test1)

val test2 = Array.fill(1000)(" ").mkString("")
isEnglishTextNaive(test2)

